import { Container, Row, Col, BreadcrumbItem, Breadcrumb } from "shards-react";
import { Tab, Tabs, TabContent } from "react-bootstrap";

// Layout
import Layout from "../../components/Layout";

const SpanishAdjectives = props => (
  <Layout>
    <Container>
      <Breadcrumb>
        <BreadcrumbItem>
          <a href="/">Home</a>
        </BreadcrumbItem>
        <BreadcrumbItem>
          <a href="/guide">Guides</a>
        </BreadcrumbItem>
        <BreadcrumbItem active>Spanish Adjectives</BreadcrumbItem>
      </Breadcrumb>
      <h4>Spanish Adjectives</h4>
    </Container>
  </Layout>
);

export default SpanishAdjectives;
